import React from "react";
import NewProduct from "../home/NewProduct";
import BestSeller from '../home/BestSeller'
const Home = () => {
  return (

    <div className="body" >
      
      <div className="jumbotron container mt-4">
        <h1 className="display-4 mt-3 text-center">สั่งยาออนไลน์ผ่านแชทกับเภสัชง่ายๆ</h1>
        <p className="lead text-center mb-4">เรามีบริการส่งยาไปที่บ้าน สะดวก รวดเร็ว และมีความปลอดภัย</p>
      <img src="1160_generated2.jpg" alt="banner" class="img-fluid   rounded  " />
      
      </div>
      
      
      
      {/* New Product */}
      <h4 
      className="text-center p-3 mt-5   mb-5 display-4 jumbotron">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   





      {/* Best Seller */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้าขายอย่างดี
       </h4>
        <BestSeller />

    </div>
  );
};

export default Home;
